		function onpressmove(e) {
		
		
			cont.isDragged = true;
		
			var pt = that.globalToLocal(e.stageX, e.stageY);
		
			var newX = pt.x - e.currentTarget.offset.x;
			var newY = pt.y - e.currentTarget.offset.y;
		
		
			var mult = scaleFac * firstwidth;
		
			if (mult / 2 - (413.75 - newX) > firstwidth / 2 && mult / 2 - (newX - 413.75) > firstwidth / 2) {
		
				e.currentTarget.x = newX;
		
				update_coord = true; //much smoother because it refreshes the screen every pixel movement instead of the FPS set on the Ticker
		                   previous_x_update = true;
			}
		
			var mult2 = scaleFac * firstheight;
			if (mult2 / 2 - (227 - newY) > firstheight / 2 && mult2 / 2 - (newY - 227) > firstheight / 2) {
		
				e.currentTarget.y = newY;
				update_coord = true; //much smoother because it refreshes the screen every pixel movement instead of the FPS set on the Ticker
		
			}
		
			if (update_coord) {
		
				stage.update();
				update_coord = false;
			}
			console.log("from main fram 1 : cont.x  " + cont.x);
		
		
		
		
		
		}
		
		
